import React, { Component } from 'react';
import { Draggable } from 'react-beautiful-dnd';
import './uploadFile.css';

export default class UploadFile extends Component {
    constructor(props) {
        super(props);


    }
    render() {
        const file = [
            { id: '1', file: 'One' },
            { id: '2', file: 'Two' },
            { id: '3', file: 'Three' },
            { id: '4', file: 'Foure' },

        ]
        return (
            <div>
                <h1>Upload Here File</h1>
                {
                    file.map((item, index) => {
                        //  console.log('images >>', image.id)
                        return (
                            <Draggable draggableId={item.id.toString()}
                                index={index}
                                key={index}
                            >
                                {(provided, snapshot) => (
                                    <div
                                        ref={provided.innerRef}
                                        {...provided.draggableProps}
                                        {...provided.dragHandleProps}
                                        className='draggableThumb'
                                    >

                                        <h1 className='file-container'>
                                           {file}
                                        </h1>
                                    </div>
                                )}
                            </Draggable>
                        )
                    })
                }
            </div>
        )
    }
}
